import {createRef, useState} from "react";
import {Redirect} from "react-router-dom";
import {changeUrl} from "../../Redux/reducers/showPageReducer";
import {connect} from "react-redux";

const Show_number = (props) => {

    const [yes,setYes] = useState(false);
    let val = '';
    let ref = createRef();
    const sendInfo = () =>{
        console.log("tap")
        props.changeUrl(val);
        ref.current.value ='';
        setYes(true);
    }
    const seeValue = (e) =>{
        val = e.target.value;
    }
    if(yes) return <Redirect to={"/show"}/>
    return (
        <div className='Car_app'>
            <input type="text" name='x' placeholder='type a number' ref={ref} onChange={seeValue}/>
            <input type="text" name='x' placeholder='type a last letter' ref={ref} onChange={seeValue}/>
            <button onClick={()=> sendInfo()}>Check</button>
        </div>
    );
}

let ShowContainer = connect(null,{changeUrl})(Show_number);
export default ShowContainer;
